import React, { Component } from 'react';
import Modal from 'react-modal';
import InputMask from 'react-input-mask';
import './list-service.css';

const modalStyle = {
  // Estilos do modal...
};

class ListServicos extends Component {
  constructor() {
    super();
    this.state = {
      showModal: false,
      showForm: false, 
      selectedProduct: null,
      formFields: {
        servicoEscolhido: '',
        cpfCnpj: '',
        name: '',
        email: '',
        contact: '',
      },
    };
  }

  openModal = (product) => {
    this.setState({ showModal: true, selectedProduct: product });
  };

  closeModal = () => {
    this.setState({ showModal: false, selectedProduct: null });
  };

  openForm = (product) => {
    this.setState({ showForm: true, selectedProduct: product });
  };

  closeForm = () => {
    this.setState({ showForm: false, selectedProduct: null });
  };

  handleInputChange = (event) => {
    const { name, value } = event.target;

    this.setState((prevState) => ({
      formFields: {
        ...prevState.formFields,
        [name]: value,
      },
    }));
  };

  handleCpfCnpjChange = (event) => {
    const { value } = event.target;

    // Verifica o número de caracteres inseridos para alternar entre CPF e CNPJ
    const isCpf = value.length === 11;
    const mask = isCpf ? '999.999.999-99' : '99.999.999/9999-99';

    this.setState((prevState) => ({
      formFields: {
        ...prevState.formFields,
        cpfCnpj: value,
      },
      cpfCnpjMask: mask,
    }));
  };

  render() {
    const { selectedProduct, showForm, cpfCnpjMask } = this.state;
    const { products } = this.props;

    return (
      <div className='list-services'>
        {products.map((product, index) => (
          <div className='product' key={index}>
            {/* ... Outros detalhes do produto ... */}
            <a className='contrate' href='#' onClick={() => this.openForm(product)}>
              Contrate Já
            </a>
          </div>
        ))}

        <Modal isOpen={this.state.showModal} onRequestClose={this.closeModal} style={modalStyle}>
          {/* Modal de detalhes do produto */}
        </Modal>

        <Modal isOpen={showForm} onRequestClose={this.closeForm} style={modalStyle}>
          {showForm && (
            <div className='modal'>
              <button className='close' onClick={this.closeForm}>
                X
              </button>
              <h3>Formulário de Contratação</h3>
              <form>
                <label htmlFor="servicoEscolhido">Serviço Escolhido :</label>
                <input
                  type="text"
                  id="servicoEscolhido"
                  name="servicoEscolhido"
                  value={selectedProduct ? selectedProduct.category + ': ' + selectedProduct.name : ''}
                  disabled
                />

                <label htmlFor="cpfCnpj">CPF ou CNPJ :</label>
                <InputMask
                  mask={cpfCnpjMask}
                  maskPlaceholder=""
                  type="text"
                  id="cpfCnpj"
                  name="cpfCnpj"
                  value={this.state.formFields.cpfCnpj}
                  onChange={this.handleCpfCnpjChange}
                />

                <label htmlFor="name">Nome Completo :</label>
                <input
                  type="text"
                  id="name"
                  name="name"
                  value={this.state.formFields.name}
                  onChange={this.handleInputChange}
                />

                <label htmlFor="email">Email :</label>
                <InputMask
                  mask="email" // Máscara para email
                  maskPlaceholder=""
                  type="email"
                  id="email"
                  name="email"
                  value={this.state.formFields.email}
                  onChange={this.handleInputChange}
                />

                <label htmlFor="contact">Contato :</label>
                <InputMask
                  mask="(99) 99999-9999" // Máscara para telefone no formato (00)00000-0000
                  maskPlaceholder=""
                  type="tel"
                  id="contact"
                  name="contact"
                  value={this.state.formFields.contact}
                  onChange={this.handleInputChange}
                />
              </form>
            </div>
          )}
        </Modal>
      </div>
    );
  }
}

export default ListServicos;
